import React from 'react'
import { useQuery } from 'react-query'

const Dummy = () => {

    const mobilecatalogue = useQuery('mobilecatalogue', async () => {
        const response = await fetch('https://pcat.mobile.xfinity.com/products?category=DEVICE&limit=23');
        return response.json();
    });

    if(mobilecatalogue.isLoading){
        return <h1>Loading...</h1>
      }

    const phone = mobilecatalogue.data
    console.log(phone.products[0].name)

    return (
        <>
        Mobile catalogue
        <div className='flex flex-row flex-wrap'>

            {Array.from({ length: 10 }).map((_, i) => (
                <div key={i}>
                    <div className=' bg-slate-white border-2 border-red-200 rounded-xl p-6 w-fit m-4 hover:border-blue-700 justify-items-center'>
                    <img src={phone.products[0].image.url} width="250"/>
                        <h3>iphone 12</h3>
                        <h3>price: $1200</h3>
                    </div>
                </div>
            ))}
        </div>  
        </>
    )
}

export default Dummy
